.storybook-card {
  border-radius: 12px;
  overflow: hidden;
  transition: all 0.3s ease;
  font-family: 'Inter', -apple-system, BlinkMacSystemFont, sans-serif;
  background: white;
  box-sizing: border-box;
  display: flex;
  flex-direction: column;
}

/* Variantes */
.card--default {
  border: 1px solid #e1e5e9;
}

.card--highlighted {
  border: 2px solid #3b82f6;
  box-shadow: 0 4px 6px -1px rgba(59, 130, 246, 0.1);
}

.card--elevated {
  border: none;
  box-shadow: 0 10px 15px -3px rgba(0, 0, 0, 0.1), 0 4px 6px -2px rgba(0, 0, 0, 0.05);
}

.card--bordered {
  border: 2px solid #d1d5db;
  background: #f9fafb;
}

/* Tamaños */
.card--small { max-width: 300px; }
.card--medium { max-width: 400px; }
.card--large { max-width: 500px; }

/* Estados */
.card--disabled {
  opacity: 0.6;
  pointer-events: none;
}

.card--loading {
  position: relative;
  overflow: hidden;
}

.card--loading::after {
  content: '';
  position: absolute;
  top: 0;
  left: -100%;
  width: 100%;
  height: 100%;
  background: linear-gradient(90deg, transparent, rgba(255,255,255,0.4), transparent);
  animation: loading 1.5s infinite;
}

@keyframes loading {
  0% { left: -100%; }
  100% { left: 100%; }
}

/* Header */
.card-header {
  display: flex;
  justify-content: space-between;
  align-items: flex-start;
  padding: 16px 20px 12px;
  border-bottom: 1px solid #f1f5f9;
}

.header-content {
  display: flex;
  align-items: flex-start;
  gap: 12px;
  flex: 1;
}

.avatar {
  border-radius: 50%;
  object-fit: cover;
  flex-shrink: 0;
}

.avatar--small { width: 32px; height: 32px; }
.avatar--medium { width: 40px; height: 40px; }
.avatar--large { width: 48px; height: 48px; }

.header-text {
  flex: 1;
  min-width: 0;
}

.card-title {
  margin: 0 0 4px 0;
  font-size: 1.125rem;
  font-weight: 600;
  color: #1f2937;
  line-height: 1.4;
}

.card-subtitle {
  margin: 0;
  font-size: 0.875rem;
  color: #6b7280;
  line-height: 1.4;
}

.header-actions {
  display: flex;
  gap: 8px;
  margin-left: 12px;
}

.icon-button {
  background: none;
  border: none;
  padding: 6px;
  border-radius: 6px;
  cursor: pointer;
  font-size: 16px;
  transition: all 0.2s ease;
  color: #6b7280;

  &:hover {
    background: #f3f4f6;
    color: #374151;
  }

  &.favorited {
    color: #ef4444;
  }
}

/* Imagen */
.card-image {
  position: relative;
  width: 100%;
  height: 200px;
  overflow: hidden;

  img {
    width: 100%;
    height: 100%;
    object-fit: cover;
    transition: transform 0.3s ease;
  }
}

.storybook-card:hover .card-image img {
  transform: scale(1.05);
}

.image-badge {
  position: absolute;
  top: 12px;
  right: 12px;
  background: #ef4444;
  color: white;
  padding: 4px 8px;
  border-radius: 12px;
  font-size: 0.75rem;
  font-weight: 600;
}

/* Contenido */
.card-content {
  padding: 16px 20px;
  flex: 1;
}

.card-text {
  margin: 0;
  color: #4b5563;
  line-height: 1.6;
  font-size: 0.875rem;
}

/* Acciones */
.card-actions {
  padding: 0 20px 16px;
  display: flex;
  gap: 12px;
  justify-content: flex-end;
}

.btn-primary, .btn-secondary {
  padding: 8px 16px;
  border: none;
  border-radius: 6px;
  font-size: 0.875rem;
  font-weight: 500;
  cursor: pointer;
  transition: all 0.2s ease;

  &:disabled {
    opacity: 0.5;
    cursor: not-allowed;
  }
}

.btn-primary {
  background: #3b82f6;
  color: white;

  &:hover:not(:disabled) {
    background: #2563eb;
  }
}

.btn-secondary {
  background: #f3f4f6;
  color: #374151;
  border: 1px solid #d1d5db;

  &:hover:not(:disabled) {
    background: #e5e7eb;
  }
}

/* Footer */
.card-footer {
  padding: 12px 20px;
  border-top: 1px solid #f1f5f9;
  display: flex;
  justify-content: space-between;
  align-items: center;
  background: #fafbfc;
}

.footer-text, .timestamp {
  font-size: 0.75rem;
  color: #6b7280;
}

.timestamp {
  color: #9ca3af;
}

/* Responsive */
@media (max-width: 480px) {
  .card-header {
    padding: 12px 16px 8px;
    flex-direction: column;
    gap: 12px;
  }

  .header-actions {
    margin-left: 0;
    align-self: flex-end;
  }

  .card-actions {
    flex-direction: column;
  }
}

